import React from "react";

const ImageLinkForm = (props) => {
  return (
    <div className="imageLinkForm">
      <p className="f3 w-80 center">
        Fill in an image url and let Big Brother make its job
      </p>
      <div className="center">
        <div className="form pa4 br2 shadow-5 center">
          <input
            className="url f4 pa2 mr1 w-70 br2 bw0"
            onChange={props.onInputChange}
            type="text"
          ></input>
          <button
            className="detect w-30 grow br2 f4 tc ph3 link pv2 bg white bg-light-turquoise dib b--white ba bw1"
            onClick={props.onSubmit}
          >
            Show results
          </button>
        </div>
      </div>
    </div>
  );
};
export default ImageLinkForm;
